import { Nav, Tab } from "react-bootstrap";
// import "../../../app.css";
import React from "react";

// import styles from "./Analytics.module.scss";
// import Line from "./Charts/Line";
// import StackedColumns from "./Charts/StackedColumns";
// import GroupedBars from "./Charts/GroupedBars";
// import { Link } from "react-router-dom";
// import { WiStars } from "react-icons/wi";
// import { FaArrowRight } from "react-icons/fa";

const UsermanageCustomer = () => {
  return (
    <>
      <div className="profile_tab_div container bg-white m-3">
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <div className="profile_tab_div2">
            <div className="row">
              <div className="col-12">
                <Nav variant="pills" className="flex">
                  <Nav.Item>
                    <Nav.Link eventKey="first">Customers</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link eventKey="second">Employees</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link eventKey="Projects">Sub-Contactor</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link eventKey="second1">Resceptions</Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link eventKey="second2">Refereers</Nav.Link>
                  </Nav.Item>
                </Nav>
              </div>
            </div>
          </div>

          <Tab.Content>
            <Tab.Pane eventKey="OffBoard">
              <div className="m_t"></div>
              {/* <OffBoard /> */}
            </Tab.Pane>
            <Tab.Pane eventKey="MyRole">
              <div className="m_t"></div>
              <h1>My Role</h1>
            </Tab.Pane>
            <Tab.Pane eventKey="first">
              <div className="m_t"></div>
              {/* <AnnouncementFilter />
                <Announcement /> */}
            </Tab.Pane>
            <Tab.Pane eventKey="second">
              <div className="m_t"></div>
              <div>{/* <AboutProfile /> */}</div>
            </Tab.Pane>
            <Tab.Pane eventKey="second1">
              <div className="m_t"></div>
              {/* <Experience /> */}
              <div className="m_t"></div>
              {/* <PreviousExperiences /> */}
            </Tab.Pane>
            <Tab.Pane eventKey="second2">
              <div className="m_t"></div>
              {/* <EmployeesDocument /> */}
            </Tab.Pane>
            <Tab.Pane eventKey="Assets">
              <div className="m_t"></div>
              {/* <IssueAssets /> */}
              <div className="m_t"></div>
              {/* <ReturnIssueAssets /> */}
            </Tab.Pane>
            <Tab.Pane eventKey="Board">
              <div className="m_t"></div>

              <div className="profile_iner_cont">
                <div className="EmployeesDocument_top_title">
                  <h3> Salary Stracture</h3>
                </div>
                {/* <SalaryStracture /> */}
              </div>
            </Tab.Pane>
            <Tab.Pane eventKey="Projects">
              <div className="m_t"></div>
              {/* <Projects /> */}
            </Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    </>
  );
};

export default UsermanageCustomer;
